import Loginmodal from "./logincontext/loginmodal";
import Signupmodal from "./signupcontext/signup";
const Login = ({setIsUser})=> {
    const [islogin,setIslogin] = useState(true);
    return(
        <>
        {islogin ? <Signupmodal setIslogin={setIslogin}/> :<Loginmodal setIsUser={setIsUser} setIslogin={setIslogin}/>}
        </>
    )
}

export default Login
